import React from 'react';
import { Link } from 'react-router-dom';
import {motion} from "framer-motion";

const Home = () => {
  return (
    <motion.div 
    initial={{opacity: 0}}
    animate={{opacity: 1}}
    transition={{delay: 0.2, duration: 1.55}}
    className="home container">
      <motion.h2 animate={{}}>
        Welcome to Pizza Joint
      </motion.h2>
      <Link to="/base">
        <motion.button
          whileHover={{scale: 1.1, color: "rgba(100,0,123,1)"}}
        >
          Create Your Pizza
        </motion.button>
      </Link>
    </motion.div>
  )
}

export default Home;
